// src/components/NGODashboard.js
import React, { useEffect, useState } from "react";
import axios from "axios";
import NGODonationCard from "./NGODonationCard";

export default function NGODashboard({ token, ngo, onLogout }) {
  const [donations, setDonations] = useState([]);
  const [stats, setStats] = useState(null);
  const [loading, setLoading] = useState(false);
  const [availability, setAvailability] = useState(true);

  useEffect(() => {
    if (!token) return;
    loadAll();
    // eslint-disable-next-line
  }, [token]);

  async function loadAll() {
    setLoading(true);
    try {
      const [dRes, sRes] = await Promise.all([
        axios.get("http://localhost:5000/api/ngo/dashboard/assigned", { headers: { Authorization: `Bearer ${token}` } }),
        axios.get("http://localhost:5000/api/ngo/dashboard/stats", { headers: { Authorization: `Bearer ${token}` } })
      ]);
      setDonations(dRes.data.donations || []);
      setStats(sRes.data || null);
      if (sRes.data) setAvailability(sRes.data.capacityCurrent > 0);
    } catch (err) {
      console.error(err);
    } finally {
      setLoading(false);
    }
  }

  async function handleStatusChange(id, status) {
    try {
      await axios.patch(`http://localhost:5000/api/ngo/dashboard/donation/${id}/status`, { status }, { headers: { Authorization: `Bearer ${token}` } });
      await loadAll();
    } catch (err) {
      console.error(err);
    }
  }

  async function toggleAvailability() {
    try {
      const newAvail = !availability;
      await axios.patch("http://localhost:5000/api/ngo/dashboard/availability", { availability: newAvail }, { headers: { Authorization: `Bearer ${token}` } });
      setAvailability(newAvail);
    } catch (err) {
      console.error(err);
    }
  }

  return (
    <div className="page-container">
      <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center", gap: 12 }}>
        <div style={{ display: "flex", alignItems: "center", gap: 12 }}>
          {ngo?.logoUrl && <img src={ngo.logoUrl} alt="logo" style={{ width: 56, height: 56, borderRadius: 8, objectFit: "cover" }} />}
          <div>
            <div style={{ fontWeight: 700 }}>{ngo?.name}</div>
            <div style={{ color: "#666" }}>{ngo?.address}</div>
          </div>
        </div>
        <div style={{ display: "flex", gap: 10 }}>
          <button className={availability ? "primary-btn" : "nav .danger"} onClick={toggleAvailability}>
            {availability ? "Available" : "Unavailable"}
          </button>
          <button className="nav danger" onClick={onLogout}>Logout</button>
        </div>
      </div>

      <div style={{ marginTop: 18 }}>
        <div style={{ display: "flex", gap: 12, alignItems: "center" }}>
          <div className="card" style={{ padding: 12 }}>
            <div style={{ fontSize: 18, fontWeight: 700 }}>{stats?.capacityCurrent ?? "—"}</div>
            <div style={{ color: "#666" }}>Current capacity</div>
          </div>

          <div className="card" style={{ padding: 12 }}>
            <div style={{ fontSize: 18, fontWeight: 700 }}>{stats?.assignedCount ?? 0}</div>
            <div style={{ color: "#666" }}>Total assigned</div>
          </div>

          <div className="card" style={{ padding: 12 }}>
            <div style={{ fontSize: 18, fontWeight: 700 }}>{stats?.pendingCount ?? 0}</div>
            <div style={{ color: "#666" }}>Pending</div>
          </div>
        </div>

        <h3 style={{ marginTop: 18 }}>Assigned Donations</h3>

        {loading && <p>Loading…</p>}
        {!loading && donations.length === 0 && <p>No assigned donations.</p>}

        <div style={{ display: "grid", gap: 12, marginTop: 10 }}>
          {donations.map(d => (
            <NGODonationCard key={d._id} d={d} onStatusChange={handleStatusChange} />
          ))}
        </div>
      </div>
    </div>
  );
}
